import './App.css';

function Header() {
  return(
    <div className="navbar bg-base-100">
      <div className="navbar-start">
        <h2>My Poca Wishlist Maker</h2>
      </div>
      <div className="navbar-end flex-none">
        <ul className="menu menu-horizontal px-1"> 
          <li><a className="btn">Items</a></li>
          <li><a className="btn">Wishlists</a></li>
        </ul>
      </div>
    </div>
  ) 
}

function App() {
  return(
    <div>
      <Header />
    </div>
  )
 
}

export default App;
